import React from 'react'
import './Card.css'

const FetchData = (props) => {
  console.log('xfkjbjdxf');
  return (
   
  <>
     <ol>
        <div className='card'>
          
        {props.userss.map((user)=>(
          <li><h3>{user.title}</h3> 
          <p>{user.description}</p>
          <h4>${user.price}</h4>
          <img src={user.image} alt= 'imagess' height='100px' width='100px'/>
          </li>
        ))
            }
           
        </div>
     </ol>
     </>
   
  )
}

export default FetchData
